export function requestToken(publicKey) {

    const body = {
        key: publicKey
    };

    const response = fetch("http://localhost:9000/auth/token/request", {
        method: "POST",
        headers: {
            'Content-Type': 'application/json',
        },
        body: JSON.stringify(body)
    });

    if (response) {
        return response.json();
    } else {
        return null;
    }
}
